import React from 'react';
import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <footer>
      <div className="footer-nav">
        <h3>Navegar</h3>
        <ul>
          <li><Link to="/contact">Contacto</Link></li>
          <li><Link to="/faq">FAQ</Link></li>
          <li><Link to="/products">Productos</Link></li>
        </ul>
      </div>
    </footer>
  );
}

export default Footer;
